import React, { useState, useMemo } from 'react';
const SAMPLE_LEADERBOARD_DATA = [
  {
    gameId: '2023090700',
    playId: '101',
    wrName: 'Justin Jefferson',
    route: 'POST',
    passResult: 'C',
    exp_Sep_xgb: 2.87,
    wos_Advanced: 0.74
  },
  {
    gameId: '2023090700',
    playId: '214',
    wrName: 'Tyreek Hill',
    route: 'GO',
    passResult: 'C',
    exp_Sep_xgb: 3.42,
    wos_Advanced: 0.81
  },
  {
    gameId: '2023090700',
    playId: '330',
    wrName: 'Ja\'Marr Chase',
    route: 'SLANT',
    passResult: 'I',
    exp_Sep_xgb: 1.95,
    wos_Advanced: 0.52
  },
  {
    gameId: '2023090800',
    playId: '88',
    wrName: 'Stefon Diggs',
    route: 'OUT',
    passResult: 'C',
    exp_Sep_xgb: 2.31,
    wos_Advanced: 0.66
  },
  {
    gameId: '2023090900',
    playId: '145',
    wrName: 'CeeDee Lamb',
    route: 'CROSS',
    passResult: 'C',
    exp_Sep_xgb: 2.64,
    wos_Advanced: 0.71
  },
  {
    gameId: '2023090900',
    playId: '201',
    wrName: 'Amon-Ra St. Brown',
    route: 'DIG',
    passResult: 'C',
    exp_Sep_xgb: 2.12,
    wos_Advanced: 0.68
  },
  {
    gameId: '2023091000',
    playId: '59',
    wrName: 'Puka Nacua',
    route: 'IN',
    passResult: 'I',
    exp_Sep_xgb: 1.88,
    wos_Advanced: 0.49
  }
];

const Leaderboard = () => {
  const [search, setSearch] = useState('');
  const [sortMetric, setSortMetric] = useState('exp_Sep_xgb');

  const filteredData = useMemo(() => {
    return SAMPLE_LEADERBOARD_DATA
      .filter(p =>
        p.wrName.toLowerCase().includes(search.toLowerCase())
      )
      .sort((a, b) => b[sortMetric] - a[sortMetric]);
  }, [search, sortMetric]);

  return (
    <div className="min-h-screen bg-gray-900 text-white p-6">
      <div className="max-w-5xl mx-auto">
        <h1 className="text-2xl font-bold mb-1">
          WR Separation Leaderboard
        </h1>
        <p className="text-sm text-gray-400 mb-4">
          Ranked by model-derived separation metrics
        </p>

        {/* Controls */}
        <div className="flex flex-col sm:flex-row gap-3 mb-4">
          <input
            type="text"
            placeholder="Search wide receiver..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="flex-1 bg-gray-800 border border-gray-700 rounded-lg px-3 py-2 text-sm"
          />

          <select
            value={sortMetric}
            onChange={(e) => setSortMetric(e.target.value)}
            className="bg-gray-800 border border-gray-700 rounded-lg px-3 py-2 text-sm"
          >
            <option value="exp_Sep_xgb">exp_Sep_xgb</option>
            <option value="wos_Advanced">wos_Advanced</option>
          </select>
        </div>

        {/* Table */}
        <div className="overflow-x-auto rounded-lg border border-gray-700">
          <table className="w-full text-sm">
            <thead className="bg-gray-800">
              <tr className="text-gray-400 border-b border-gray-700">
                <th className="text-left px-3 py-2">Rank</th>
                <th className="text-left px-3 py-2">WR</th>
                <th className="text-left px-3 py-2">Route</th>
                <th className="text-right px-3 py-2">exp_Sep_xgb</th>
                <th className="text-right px-3 py-2">wos_Advanced</th>
                <th className="text-center px-3 py-2">Result</th>
              </tr>
            </thead>
            <tbody>
              {filteredData.map((p, i) => (
                <tr
                  key={`${p.gameId}_${p.playId}`}
                  className="border-b border-gray-800 hover:bg-gray-800/60"
                >
                  <td className="px-3 py-2 font-mono">{i + 1}</td>
                  <td className="px-3 py-2 font-medium">
                    {p.wrName}
                  </td>
                  <td className="px-3 py-2 text-gray-400">
                    {p.route}
                  </td>
                  <td className="px-3 py-2 text-right font-mono">
                    {p.exp_Sep_xgb.toFixed(3)}
                  </td>
                  <td className="px-3 py-2 text-right font-mono">
                    {p.wos_Advanced.toFixed(3)}
                  </td>
                  <td className="px-3 py-2 text-center">
                    <span
                      className={`px-2 py-1 rounded text-xs font-bold ${
                        p.passResult === 'C'
                          ? 'bg-green-600'
                          : 'bg-red-600'
                      }`}
                    >
                      {p.passResult === 'C' ? 'C' : 'I'}
                    </span>
                  </td>
                </tr>
              ))}
              {filteredData.length === 0 && (
                <tr>
                  <td
                    colSpan={6}
                    className="text-center py-6 text-gray-500"
                  >
                    No players found
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Leaderboard;
